import React from 'react';
import { Link } from 'react-router-dom';
import Login from './components/Login';

const App = () => {
  return (
    <div>
      <h1>Sistema de Restaurante</h1>
      <Link to="/">Login</Link>
      <Login />
    </div>
  );
};

export default App;
